import axios from './axios';

export default async function LoginCUIL(props) {
  try {
    const datos = await axios.get(
      '/AfiliadoDatos/BuscarPorCUIL?pCUIL=' + props,
    );

    return datos.data;
  } catch (error) {
    console.log(error);
  }
}
